    false,nt"url": null,nt"notes": "This report represents the results of the
    fourth year of the multi-year study, the Long Island National Wildlife Refuge Complex
    (Complex) Environmental Contaminants Background Survey. The goal is to establish
    a baseline for future studies and to assist the managers in identifying potential
    impacts to fish and wildlife resources from environmental contaminants. Sediment
    and soil were sampled in 1993 at two refuges, a wildlife management area, and an
    additional unit of the Complex: Conscience Point National Wildlife Refuge (NWR),
    Morton NWR, Lido Beach Wildlife Management Area (WMA), and the Sayville Unit. The
    samples were analyzed for inorganic and organic chemical residues. Six composite
    biological samples consisting of ribbed mussel (Geukensia demissus) and one composite
    sample of finfish from the families Belonidae, Cyprinodontidae, and Atherinidae
    were obtained from Conscience Point NWR, Morton NWR, and Lido Beach WMA to assess
    inorganic and organic chemical burdens in wildlife. In addition, Microtox testing
    was performed on water, elutriate, and sediment samples from the sampling area.",nt"owner_org":
